import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import * as serviceWorker from "./serviceWorker";
import * as dataMgr from './dataMgr';

dataMgr.regNewTool("我的世界", function(){
    return(
        <div>
        <title> 我的世界 </title>
        </div>
    );
})


dataMgr.regNewTool("我的世界1", function(){
    return(
        <title> 我的世界1 </title>
    );
})

dataMgr.regNewTool("我的世界2", function(){
    return(
        <title> 我的世界2 </title>
    );
})

function _ToolButton(props){
    return(
        <button class="ToolButton" id={props.id} onClick = {props.onClick}>{props.buttonName}</button>
    );
}

dataMgr.regNewTool("我的世界3",_ToolButton)

class Show extends React.Component {
    render() {
        return (
            dataMgr.ShowInfo(0)
        );
    }
}

ReactDOM.render(<Show/>, document.getElementById('root'))

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
